import { useState } from 'react';
import ContainerDiv from './components/ContainerDiv/ContainerDiv';
import ImageMenu from './components/ImageMenu/ImageMenu';

function App() {

  const [ imageMenu, setImageMenu ] = useState(false);

  const handleImageMenu = () => {
    setImageMenu(prev => !prev)
  }

  return (
    <div className="App">
      <ContainerDiv />
      {imageMenu ? <ImageMenu props={handleImageMenu}/> : null}
    </div>
  );
}

export default App;
